column3:
SELECT COUNT(Match_Id) 
FROM 'Match' 
WHERE Man_of_the_Match = 'Yuvraj Singh';

SELECT Topic 
FROM Series 
WHERE LicenseType = 'Restricted';

SELECT i.case_number, i.location, i.subject_statuses 
FROM incidents i 
WHERE i.case_number IN (SELECT s.case_number FROM subjects s WHERE s.gender = 'Male');

SELECT name, installation_date, city 
FROM station 
WHERE installation_date BETWEEN '2013-08-05' AND '2013-12-31 23:59:59';

SELECT MIN(t1.groupYear) - 1991 
FROM torrents t1 
WHERE t1.artist = '2Pac' AND t1.groupYear > 1991 AND t1.releaseType = 'Album';

SELECT COUNT(*) 
FROM incidents 
WHERE subjects = 'Female' AND subject_statuses = 'Deceased';

SELECT 
  (SELECT OrderNumber FROM 'Sales Orders' WHERE WarehouseCode = 'WARE-MKL1006' LIMIT 1) - 
  (SELECT OrderNumber FROM 'Sales Orders' WHERE WarehouseCode = 'WARE-NBV1002' LIMIT 1) AS difference;
